import ReactDOM from 'react-dom';

class Home extends React.Component {

  lic = () => {

   alert(33);

  }

  render() {

    return (
     <div>

      <p>cbiuwbiucw</p>
      <button onClick={this.lic} id="lic_button">click me</button>
     </div>
    );
  }

}

export default Home;
